import React from "react";


class App extends React.Component {
  state = {
    temp: null,
    availableList: [],
    wishList: []
  }

  addToAvailable = () => {
    this.setState({ availableList: [...this.state.availableList, this.state.temp] })
  }

  render() {
    return (
      <div>
        <h1>My Wish List</h1>
        <h3>Available Items</h3>
        <input type="text" onChange={event => (this.setState({ temp: event.target.value }))} />
        <button onClick={this.addToAvailable}>Add to Available</button>
        <h3>My wishList</h3>
      </div>
    )
  }
}

export default App
